USE F1; 

CREATE TABLE result(
   resultId      INT PRIMARY KEY auto_increment
  ,raceId        INT  NOT NULL
  ,driverId      INT  NOT NULL
  ,constructorId INT  NOT NULL
  ,grid          INT  NOT NULL
  ,positionText  VARCHAR(2) NOT NULL
  ,points        NUMERIC(4,2) NOT NULL
  ,laps          INTEGER  NOT NULL
);
